import React, { useState, useEffect } from "react";
import { useHistory } from 'react-router-dom';
import queryString from 'query-string';
import { url_get_monitoring } from "./../Routes";

import '../general.css'

const Monitoring = () => {

    const [image, setImage] = useState('')

    useEffect(() => {
        console.log("HACEMOS REQUEST DE LA IMAGEN")
        var myHeaders = new Headers();
        myHeaders.append("Authorization", "Bearer eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJzdWIiOjIsImlhdCI6MTYwNjQwODg0M30.3jE521MzM1HkWIKTW7yFyBwxs6AuFQQEXwVjQD4BNjI");
        myHeaders.append("Content-Type", "application/json");

        var raw = JSON.stringify({"room":40});

        var requestOptions = {
        method: 'GET',
        headers: myHeaders,
        body: raw,
        redirect: 'follow'
        };

        fetch("http://localhost:3000/monitoring", requestOptions)
            .then(response => response.json())
            .then(result => setImage(result))
            .catch(error => console.log('error', error));

        console.log("*******************************")
    }, [])

    return (
        <div>Holskljdkasdksahdkjsahdkjsahdkjasha {image}</div>
    )
}



export default Monitoring
